import React, { memo } from 'react';
import styled from 'styled-components';
const DelBtn = styled.div`
    font-size: 14px;
    font-weight: 700;
    color: white;
    background-color: gray;
    text-align: center;
    padding: 10px 10px;
`;
const DelButton = memo(() => {
    return (
        <DelBtn>
            전체삭제
        </DelBtn>
    );
});

export default DelButton;
